import React, { Component } from 'react';
import './lst.css'

class List extends Component {
    constructor(props) {
        super(props);
        this.state = {
            data: []
        };
    }
    render() {
        return (
            <div width="100%">
                <h3 className="clearfix">后台管理系统，欢迎<span>{this.props.user}</span><span className="addBtn">新增</span></h3>
                <table width="100%">
                    <thead>
                        <tr>
                            <th>用户名</th>
                            <th>密码</th>
                            <th colSpan="2">操作</th>
                        </tr>
                    </thead>
                    <tbody>
                        {
                            this.state.data.map((value, index) => {
                                return (
                                    <tr>
                                        <td>{value.user}</td>
                                        <td>{value.password}</td>
                                        <td><a href="javascript(void(0));"></a>删除</td>
                                        <td><a href="javascript(void(0));"></a>编辑</td>
                                    </tr>
                                    )
                            })
                        }
                    </tbody>
                </table>
            </div>
        );
    }
}

export default List;
